response:
\boxed{3 < \lambda \le 4}

Para explicar brevemente: Sean los puntos fijos de f(x) = λx(1 − x). Es fácil ver que x = 0 y x = 1 − (1/λ) son puntos fijos (cuando λ ≠ 0). El punto fijo no nulo, x = 1 − (1/λ), tiene derivada f′(x) = λ − 2λx evaluada en él, lo que da f′(1 − 1/λ) = 2 − λ. Este punto fijo es estable (atractor) si |2 − λ| < 1, lo que ocurre únicamente cuando 1 < λ < 3. Así, cuando λ está en (1, 3) no existen puntos period-2 distintos de los puntos fijos.

El cambio en la estabilidad ocurre en λ = 3 (la bifurcación de período doble). Para λ > 3 el punto fijo se vuelve inestable y emerge un ciclo de período 2 distinto (es decir, existe x con f(f(x)) = x pero f(x) ≠ x). Dado que la función se define para 0 ≤ λ ≤ 4, la respuesta es que tales puntos existen si y sólo si 3 < λ ≤ 4.
